Remembrance Sunday: The Cenotaph 2014

War Documentary hosted by David Dimbleby, published by BBC in 2014 - English narration


Information
------------------------------

The prime minister, leading politicians, representatives of many of the world's religions, dignitaries from around the Commonwealth and military leaders join thousands of veterans from countless conflicts for the two minute silence, service and march past. All gather to remember those men and women who have died in action serving their country.

